	('23099020', 'Products referred to in additional noteÃƒâ€šÃ‚Â 5 to this chapter', 'Produse prevazute la nota complementara 5 de la prezentul capitol. (Nota complementara 5: Se clasifica la subpozi?ia 2309 90 20 numai reziduurile de la obtinerea amidonului de porumb, cu exceptia amestecurilor de astfel de reziduuri cu produse obtinute din alte plante sau cu produse obtinute din porumb, printr-un procedeu altul decat cel inerent procesului de fabricatie a amidonului prin procedeul umed, si care contin: reziduuri de la cernerea porumbului utilizat in procedeul umed, in proportie de maximum 15% in greutate si/sau reziduuri provenite din apa de inmuiere a porumbului prin procedeul umed, inclusiv reziduurile din apa de inmuiere utilizata la fabricarea alcoolului sau a altor derivati ai amidonului. Aceste produse pot, de asemenea, sa contina reziduuri de la extractia uleiului din germeni de porumb prin macinare prin procedeul umed. Continutul de amidon trebuie sa fie mai mic sau egal cu 28% din greutate pe produs uscat, in conformitate cu metoda prevazuta in anexa I titlul 1 la Directiva 72/199/CEE a Comisiei, continutul de grasimi trebuie sa fie mai mic sau egal cu 4,5% din greutate pe produs uscat, in conformitate cu metoda A prevazuta in anexa I la Directiva 84/4/CEE a Comisiei si continutul in proteine trebuie sa fie mai mic sau egal cu 40% din greutate pe produs uscat, in conformitate cu metoda prevazuta in anexa I titlul 2 la Directiva 72/199/CEE a Comisiei.)', '6', '230990', NULL),
