	('4102', 'Raw skins of sheep or lambs (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not with wool on or split, other than those excluded by noteÃƒâ€šÃ‚Â 1(c) to this chapter', '"Piei brute de ovine (proaspete sau sarate, uscate, cenusarite, piclate sau altfel conservate, dar netabacite, nepergamentate sau altfel preparate) chiar epilate sau spaltuite, altele decat cele excluse prin nota 1 litera (c) din acest capitol. (Nota1 litera (c): Capitolul nu cuprinde: (a) resturile si deseurile similare din piei brute (pozitia 0511); (b) pieile si partile din piei de pasari, acoperite cu pene sau puf (pozitiile 0505 sau 6701, dupa caz); (c) pieile brute, tabacite sau finisate, neepilate, ale animalelor cu blana (capitolul 43). Cu toate acestea, se clasifica la capitolul 41 pieile brute neepilate de bovine (inclusiv de bivol), de ecvidee, de ovine (cu exceptia pieilor de miel denumite ""astrahan"", ""breitschwanz"", ""caracul"", ""persan"" sau similare si a pieilor de miel de India, China, Mongolia sau Tibet), de caprine (cu exceptia pieilor de capra sau de ied de Yemen, Mongolia sau Tibet), de porcine (inclusiv de pecari), de capra neagra, de gazela, de camila (inclusiv de dromader), de ren, de elan, de cerb, de caprioara sau de caine)."', '4', '41', NULL),
