	('5911', 'Textile products and articles, for technical uses, specified in noteÃƒâ€šÃ‚Â 7Ãƒâ€šÃ‚Â to this chapter', '"Produse si articole textile pentru utilizari tehnice, mentionate la nota 7 din acest capitol: (Nota7: Pozitia 5911 cuprinde urmatoarele produse, care nu sunt clasificate la alte pozitii ale sectiunii XI: (a) produsele textile din una sau mai multe bucati, taiate la lungime sau simplu decupate in forma patrata sau dreptunghiulara (cu exceptia celor avand caracteristicile produselor de la pozitiile 5908-5910) si care sunt enumerate limitative in continuare:- tesaturile, paslele sau tesaturile captusite cu pasla, combinate cu unul sau mai multe straturi de cauciuc, piele sau alte materiale, de tipul celor utilizate pentru fabricarea garniturilor de carda si produsele similare pentru alte utilizari tehnice inclusiv panglicile din catifea impregnate cu cauciuc, pentru acoperirea sulurilor de urzeala ale masinilor de tesut;- tesaturile folosite la cernut;- ?es?turile pentru filtrare de tipul celor utilizate pentru presele de ulei sau pentru utilizari tehnice similare, inclusiv cele din par uman;- tesaturile, impaslite sau nu, chiar impregnate sau acoperite, pentru utilizari tehnice, tesute plan, cu urzeli sau bataturi multiple;- tesaturile ranforsate cu metal, de tipul celor folosite in scopuri tehnice;- cordoanele lubrifiante si benzile impletite, corzile si produsele textile similare de buraj industrial (etansare), chiar impregnate, imbracate sau ranforsate cu metal; (b) articolele textile pentru utilizari tehnice (altele decat cele de la pozitiile 5908-5910) [de exemplu, tesaturi si pasle fara sfarsit sau dotate cu mijloace de jonctiune, de tipul celor folosite la masinile pentru fabricarea hartiei si alte masini similare (de exemplu, masinile de fabricat pasta de lemn sau azbociment), discuri de polizat, garnituri de etansare, saibe si alte parti de masini sau aparate])."', '4', '59', NULL),
	('59111000', 'Textile fabrics, felt and felt-lined woven fabrics, coated, covered or laminated with rubber, leather or other material, of a kind used for card clothing, and similar fabrics of a kind used for other technical purposes, including narrow fabrics made of velvet impregnated with rubber, for covering weaving spindles (weaving beams)', 'Tesaturi, pasle si Tesaturi dublate Cu pasle, Acoperite, imbracate sau stratificate Cu cauciuc, piele sau Alte materiale, de tipul celor utilizate pentru fabricarea garniturilor de carde, si Produse similare pentru Alte utilizari tehnice, inclusiv panglic', '5', '5911', NULL),
